import React, { Component } from "react";
import StackGrid from "react-stack-grid";
import '../sass/components/_reset.scss'


class Portfolio extends Component {
  render() {
    return (
      <StackGrid
        columnWidth={150}
      >
        <div key="key1">
            <img src="https://tsuyoshiwada.github.io/react-stack-grid/images/photos/photo02.jpg"/>
        </div>

        <div key="key2">
            <img src="https://tsuyoshiwada.github.io/react-stack-grid/images/photos/photo05.jpg"/>
        </div>

        <div key="key3">
            <img src="https://tsuyoshiwada.github.io/react-stack-grid/images/photos/photo01.jpg"/>
        </div>
      </StackGrid>
    );
  }
}

export default Portfolio;
